class Solution {
    public List<Integer> rolling_max(List<Integer> numbers) {
        List<Integer> result = new ArrayList<>();
        if (numbers.isEmpty()) {
            return result;
        }

        int maxSoFar = numbers.get(0);
        for (int num : numbers) {
            if (num > maxSoFar) {
                maxSoFar = num;
            }
            result.add(maxSoFar);
        }
        return result;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.rolling_max(new ArrayList<>(List.of())).equals(List.of()),
