class Solution {
    public List<Double> find_closest_elements(List<Double> numbers) {
        // Sort the list to make finding the closest elements easier
        Collections.sort(numbers);

        // Initialize variables to store the closest pair and their distance
        List<Double> closestPair = new ArrayList<>();
        double minDistance = Double.MAX_VALUE;

        // Iterate through the sorted list to find the closest pair
        for (int i = 0; i < numbers.size() - 1; i++) {
            double currentDistance = Math.abs(numbers.get(i) - numbers.get(i + 1));
            if (currentDistance < minDistance) {
                minDistance = currentDistance;
                closestPair.clear();
                closestPair.add(numbers.get(i));
                closestPair.add(numbers.get(i + 1));
            }
        }

        return closestPair;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.find_closest_elements(new ArrayList<>(Arrays.asList(1.0, 2.0, 3.9, 4.0, 5.0, 2.2))).equals(Arrays.asList(3.9, 4.0)),
                s.find_closest_elements(new ArrayList<>(Arrays.asList(1.0, 2.0, 5.9, 4.0, 5.0))).equals(Arrays.asList(5.0, 5.9)),
