class Solution {
    public int largest_divisor(int n) {
        for (int i = n / 2; i >= 1; i--) {
            if (n % i == 0) {
                return i;
            }
        }
        return 1; // Every number is divisible by 1
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.largest_divisor(3) == 1,
                s.largest_divisor(7) == 1,
