class Solution {
    public List<Integer> factorize(int n) {
        List<Integer> factors = new ArrayList<>();
        for (int factor = 2; factor * factor <= n; factor++) {
            while (n % factor == 0) {
                factors.add(factor);
                n /= factor;
            }
        }
        if (n > 1) {
            factors.add(n);
        }
        return factors;
    }
}

