class Solution {
    public List<Integer> remove_duplicates(List<Integer> numbers) {
        Map<Integer, Integer> frequencyMap = new LinkedHashMap<>();

        // Count the frequency of each element
        for (int num : numbers) {
            frequencyMap.put(num, frequencyMap.getOrDefault(num, 0) + 1);
