class Solution {
    public boolean triples_sum_to_zero(List<Integer> l) {
        if (l.size() < 3) {
            return false;
        }

        Collections.sort(l);

        for (int i = 0; i < l.size() - 2; i++) {
            int left = i + 1;
            int right = l.size() - 1;

            while (left < right) {
                int sum = l.get(i) + l.get(left) + l.get(right);

                if (sum == 0) {
                    return true;
                } else if (sum < 0) {
                    left++;
                } else {
                    right--;
                }
            }
        }

        return false;
    }
}

