class Solution {
    public int fib4(int n) {
        if (n == 0 || n == 1 || n == 3) return 0;
        if (n == 2) return 2;

        int[] dp = new int[n + 1];
        dp[0] = 0;
        dp[1] = 0;
        dp[2] = 2;
