class Solution {
    public double median(List<Integer> l) {
        Collections.sort(l);
        int size = l.size();
        if (size % 2 == 0) {
            // If even number of elements, return the average of the two middle elements
            return (l.get(size / 2 - 1) + l.get(size / 2)) / 2.0;
        } else {
            // If odd number of elements, return the middle element
            return l.get(size / 2);
        }
    }
}

