        Set<Integer> set1 = new HashSet<>(l1);
        Set<Integer> set2 = new HashSet<>(l2);

        set1.retainAll(set2); // Retain only elements that are present in both sets

        List<Integer> result = new ArrayList<>(set1);
        Collections.sort(result); // Sort the result list

        return result;
    }
}

