class Solution {
    public String circular_shift(int x, int shift) {
        String numStr = Integer.toString(x);
        int len = numStr.length();

        // If shift is greater than the number of digits, reverse the string
        if (shift >= len) {
            return new StringBuilder(numStr).reverse().toString();
        }

        // Perform the circular shift
        shift = shift % len; // In case shift is larger than the length
        String shifted = numStr.substring(len - shift) + numStr.substring(0, len - shift);

        return shifted;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.circular_shift(100, 2).equals("001"),
                s.circular_shift(12, 2).equals("12"),
                s.circular_shift(97, 8).equals("79"),
                s.circular_shift(12, 1).equals("21"),
                s.circular_shift(11, 101).equals("11")
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

