class Solution {
    public List<Integer> pluck(List<Integer> arr) {
        List<Integer> result = new ArrayList<>();
        if (arr.isEmpty()) {
            return result;
        }

        int smallestEvenValue = Integer.MAX_VALUE;
        int smallestIndex = -1;

        for (int i = 0; i < arr.size(); i++) {
            int value = arr.get(i);
            if (value % 2 == 0 && value <= smallestEvenValue) {
                if (value < smallestEvenValue || (value == smallestEvenValue && i < smallestIndex)) {
                    smallestEvenValue = value;
                    smallestIndex = i;
                }
            }
        }

        if (smallestIndex != -1) {
            result.add(smallestEvenValue);
            result.add(smallestIndex);
        }

        return result;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.pluck(new ArrayList<>(Arrays.asList(4, 2, 3))).equals(Arrays.asList(2, 1)),
