class Solution {
    public List<Integer> strange_sort_list(List<Integer> lst) {
        List<Integer> sortedList = new ArrayList<>();
        while (!lst.isEmpty()) {
            // Find and remove the minimum value
            Integer min = Collections.min(lst);
            lst.remove(min);
            sortedList.add(min);

            // If the list is empty after removing the min, break the loop
            if (lst.isEmpty()) {
                break;
            }

            // Find and remove the maximum value
            Integer max = Collections.max(lst);
            lst.remove(max);
            sortedList.add(max);
        }
        return sortedList;
    }
}

