class Solution {
    public boolean will_it_fly(List<Integer> q, int w) {
        // Check if the list is a palindrome
        boolean isBalanced = true;
        for (int i = 0; i < q.size() / 2; i++) {
            if (!q.get(i).equals(q.get(q.size() - 1 - i))) {
                isBalanced = false;
                break;
            }
        }

        // Calculate the sum of the elements
        int sum = 0;
        for (int num : q) {
            sum += num;
        }

        // Check if the sum is less than or equal to the maximum weight and if the list is balanced
        return isBalanced && sum <= w;
    }
}

