class Solution {
    public boolean is_simple_power(int x, int n) {
        if (n == 1) {
            return x == 1;
        }
        if (x == 1) {
            return n == 1;
        }
        if (x < 1 || n < 1) {
            return false;
        }

        int power = 1;
        while (power < x) {
            power *= n;
        }
        return power == x;
    }
}

