class Solution {
    public String decimal_to_binary(int decimal) {
        if (decimal == 0) {
            return "db0db";
        }
        StringBuilder binary = new StringBuilder();
        while (decimal > 0) {
            binary.insert(0, decimal % 2);
            decimal /= 2;
        }
        return "db" + binary.toString() + "db";
    }
}

