class Solution {
    /**
    Given a positive integer n, return the count of the numbers of n-digit
    positive integers that start or end with 1.
     */
    public int starts_one_ends(int n) {
        if (n == 1) {
            return 1; // Only one 1-digit number starts or ends with 1
        }

        // For n-digit numbers, there are 9^(n-1) numbers that start with 1
        // and 9^(n-1) numbers that end with 1.
        // However, we need to subtract the overlap (numbers that start and end with 1)
        // which is 9^(n-2).
        int countStartsWithOne = (int) Math.pow(9, n - 1);
        int countEndsWithOne = (int) Math.pow(9, n - 1);
        int countBothStartAndEndWithOne = (int) Math.pow(9, n - 2);

        return countStartsWithOne + countEndsWithOne - countBothStartAndEndWithOne;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.starts_one_ends(1) == 1,
                s.starts_one_ends(2) == 18,
                s.starts_one_ends(3) == 180,
                s.starts_one_ends(4) == 1800,
                s.starts_one_ends(5) == 18000
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

