class Solution {
    public List<List<Integer>> get_row(List<List<Integer>> lst, int x) {
        List<List<Integer>> result = new ArrayList<>();

        for (int i = 0; i < lst.size(); i++) {
            List<Integer> row = lst.get(i);
            for (int j = 0; j < row.size(); j++) {
                if (row.get(j) == x) {
                    List<Integer> coordinate = new ArrayList<>();
                    coordinate.add(i);
                    coordinate.add(j);
                    result.add(coordinate);
                }
            }
        }

        // Sort by rows in ascending order
        result.sort((a, b) -> a.get(0).compareTo(b.get(0)));

        // Sort columns in descending order within each row
        for (int i = 0; i < result.size() - 1; i++) {
            if (result.get(i).get(0).equals(result.get(i + 1).get(0))) {
                Collections.sort(result.subList(i, i + 2), (a, b) -> b.get(1).compareTo(a.get(1)));
            }
        }

        return result;
    }
}

