class Solution {
    public Optional<Integer> next_smallest(List<Integer> lst) {
        if (lst == null || lst.size() < 2) {
            return Optional.empty();
        }

        TreeSet<Integer> set = new TreeSet<>(lst);
        Integer first = set.pollFirst();
        Integer second = set.pollFirst();

        if (first != null && second != null && !first.equals(second)) {
            return Optional.of(second);
        } else if (set.size() > 0) {
            return Optional.of(set.first());
        }

        return Optional.empty();
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.next_smallest(new ArrayList<>(Arrays.asList(1, 2, 3, 4, 5))).get() == 2,
