class Solution {
    public boolean moveOneBall(List<Integer> arr) {
        if (arr.isEmpty()) {
            return true;
        }

        // Find the index where the array should start to be in non-decreasing order
        int n = arr.size();
        int startIndex = -1;
        for (int i = 0; i < n - 1; i++) {
            if (arr.get(i) > arr.get(i + 1)) {
                if (startIndex != -1) {
                    // More than one place where the order is broken
                    return false;
                }
                startIndex = i + 1;
            }
        }

        // If no break in order, the array is already sorted
        if (startIndex == -1) {
            return true;
        }

        // Check if the array is sorted after the identified start index
        for (int i = startIndex; i < n - 1; i++) {
            if (arr.get(i) > arr.get(i + 1)) {
                return false;
            }
        }

        // Check if the last element is less than or equal to the first element
        return arr.get(n - 1) <= arr.get(0);
    }
}

