class Solution {
    public int count_nums(List<Integer> arr) {
        int count = 0;
        for (Integer num : arr) {
            if (sumOfDigits(num) > 0) {
                count++;
            }
        }
        return count;
    }

    private int sumOfDigits(int num) {
        int sum = 0;
        boolean isNegative = num < 0;
        while (num != 0) {
            int digit = num % 10;
            if (isNegative && num < 0 && sum == 0) {
                sum += digit; // Add the first negative digit as is
            } else {
                sum += Math.abs(digit); // Add the absolute value of the digit
            }
            num /= 10;
        }
        return sum;
    }
}

