class Solution {
    public String exchange(List<Integer> lst1, List<Integer> lst2) {
        // Count the number of odd elements in lst1
        long oddCountLst1 = lst1.stream().filter(num -> num % 2 != 0).count();

        // Count the number of even elements in lst2
        long evenCountLst2 = lst2.stream().filter(num -> num % 2 == 0).count();

        // If there are enough even elements in lst2 to replace all odd elements in lst1, return "YES"
        if (oddCountLst1 <= evenCountLst2) {
            return "YES";
        } else {
            return "NO";
        }
    }
}

