class Solution {
    public String match_parens(List<String> lst) {
        String first = lst.get(0);
        String second = lst.get(1);

        // Check concatenation in both orders
        if (isBalanced(first + second) || isBalanced(second + first)) {
            return "Yes";
        } else {
            return "No";
        }
    }

    private boolean isBalanced(String s) {
        int balance = 0;
        for (char c : s.toCharArray()) {
            if (c == '(') {
                balance++;
            } else if (c == ')') {
                balance--;
            }
            if (balance < 0) {
                return false;
            }
        }
        return balance == 0;
    }
}

