class Solution {
    public boolean valid_date(String date) {
        // Check if the date string is empty
        if (date == null || date.isEmpty()) {
            return false;
        }

        // Define the date format
        String dateFormat = "^(0[1-9]|1[0-2])-(0[1-9]|[12][0-9]|3[01])-(\\d{4})$";

        // Create a Pattern object
        Pattern pattern = Pattern.compile(dateFormat);

        // Create a Matcher object
        Matcher matcher = pattern.matcher(date);

        // Check if the date matches the format
        if (!matcher.matches()) {
            return false;
        }

        // Extract the month, day, and year from the date string
        String[] parts = date.split("-");
        int month = Integer.parseInt(parts[0]);
        int day = Integer.parseInt(parts[1]);
        int year = Integer.parseInt(parts[2]);

        // Validate the number of days based on the month
        if (month == 2) {
            if (day > 29) {
                return false;
            }
        } else if (month == 4 || month == 6 || month == 9 || month == 11) {
            if (day > 30) {
                return false;
            }
        } else if (month == 1 || month == 3 || month == 5 || month == 7 || month == 8 || month == 10 || month == 12) {
            if (day > 31) {
                return false;
            }
        }

        // If all checks pass, the date is valid
        return true;
    }
}

