class Solution {
    public List<Integer> get_odd_collatz(int n) {
        Set<Integer> oddNumbers = new HashSet<>();

        while (n != 1) {
            if (n % 2 == 1) {
                oddNumbers.add(n);
            }
            n = (n % 2 == 0) ? n / 2 : 3 * n + 1;
        }
        oddNumbers.add(1); // Always add 1 as it is part of the sequence

        List<Integer> sortedOddNumbers = new ArrayList<>(oddNumbers);
        Collections.sort(sortedOddNumbers);

        return sortedOddNumbers;
    }
}

