class Solution {
    public Object split_words(String txt) {
        // Check if there are whitespaces in the string
        if (txt.contains(" ")) {
            return Arrays.asList(txt.split(" "));
        }
        // Check if there are commas in the string
        else if (txt.contains(",")) {
            return Arrays.asList(txt.split(","));
        }
        // If no whitespaces or commas, count the number of lowercase letters with odd order
        else {
            int count = 0;
            for (char c : txt.toCharArray()) {
                if (Character.isLowerCase(c) && ((c - 'a') % 2 == 1)) {
                    count++;
                }
            }
            return count;
        }
    }
}

