class Solution {
    public boolean is_sorted(List<Integer> lst) {
        if (lst.size() <= 1) {
            return true;
        }

        Map<Integer, Integer> frequencyMap = new HashMap<>();
        for (int i = 1; i < lst.size(); i++) {
            // Check if the current element is less than the previous element
            if (lst.get(i) < lst.get(i - 1)) {
                return false;
            }

            // Update the frequency map
            frequencyMap.put(lst.get(i), frequencyMap.getOrDefault(lst.get(i), 0) + 1);

            // Check if any element appears more than twice
            if (frequencyMap.get(lst.get(i)) > 2) {
                return false;
            }
        }

        // Check the first element separately
        frequencyMap.put(lst.get(0), frequencyMap.getOrDefault(lst.get(0), 0) + 1);
        if (frequencyMap.get(lst.get(0)) > 2) {
            return false;
        }

        return true;
    }
}

