class Solution {
    private static final int[] directions = {0, 1, 0, -1, 0};

    public List<Integer> minPath(List<List<Integer>> grid, int k) {
        int N = grid.size();
        PriorityQueue<Path> pq = new PriorityQueue<>((a, b) -> {
            for (int i = 0; i < k; i++) {
                if (a.path.get(i) != b.path.get(i)) {
                    return a.path.get(i) - b.path.get(i);
                }
            }
            return 0;
        });

        for (int i = 0; i < N; i++) {
            for (int j = 0; j < N; j++) {
                pq.offer(new Path(i, j, new ArrayList<>(List.of(grid.get(i).get(j)))));
            }
        }

        while (!pq.isEmpty()) {
            Path current = pq.poll();
            if (current.path.size() == k) {
                return current.path;
            }
            for (int d = 0; d < 4; d++) {
                int ni = current.i + directions[d];
                int nj = current.j + directions[d + 1];
                if (ni >= 0 && ni < N && nj >= 0 && nj < N) {
                    List<Integer> newPath = new ArrayList<>(current.path);
                    newPath.add(grid.get(ni).get(nj));
                    pq.offer(new Path(ni, nj, newPath));
                }
            }
        }

        return new ArrayList<>();
    }

    private static class Path {
        int i, j;
        List<Integer> path;

        Path(int i, int j, List<Integer> path) {
            this.i = i;
            this.j = j;
            this.path = path;
        }
    }
}

