class Solution {
    public boolean is_nested(String string) {
        Stack<Character> stack = new Stack<>();
        boolean nestedFound = false;

        for (char ch : string.toCharArray()) {
            if (ch == '[') {
                if (!stack.isEmpty()) {
                    nestedFound = true;
                }
                stack.push(ch);
            } else if (ch == ']') {
                if (stack.isEmpty()) {
                    return false; // Unmatched closing bracket
                }
                stack.pop();
            }
        }

        return nestedFound && stack.isEmpty(); // Ensure all brackets are matched
    }
}

