class Solution {
    public String file_name_check(String file_name) {
        // Define the valid extensions
        Set<String> validExtensions = new HashSet<>(Arrays.asList("txt", "exe", "dll"));

        // Split the file name by the dot
        String[] parts = file_name.split("\\.", -1);

        // Check if there is exactly one dot
        if (parts.length != 2) {
            return "No";
        }

        // Extract the name and extension parts
        String namePart = parts[0];
        String extensionPart = parts[1];

        // Check if the name part starts with a letter and contains no more than three digits
        if (!Character.isLetter(namePart.charAt(0)) || !namePart.matches("[a-zA-Z][a-zA-Z0-9]{0,2}")) {
            return "No";
        }

        // Check if the extension part is valid
        if (!validExtensions.contains(extensionPart)) {
            return "No";
        }

        return "Yes";
    }
}

