class Solution {
    public List<Integer> order_by_points(List<Integer> nums) {
        nums.sort((a, b) -> {
            int sumA = sumOfDigits(a);
            int sumB = sumOfDigits(b);
            if (sumA != sumB) {
                return Integer.compare(sumA, sumB);
            } else {
                return Integer.compare(nums.indexOf(a), nums.indexOf(b));
            }
        });
        return nums;
    }

    private int sumOfDigits(int num) {
        int sum = 0;
        boolean isNegative = num < 0;
        while (num != 0) {
            int digit = num % 10;
            if (isNegative && num < 0 && sum == 0) {
                digit *= -1;
            }
            sum += digit;
            num /= 10;
        }
        return sum;
    }
}

