class Solution {
    public List<Integer> even_odd_count(int num) {
        num = Math.abs(num); // Ensure the number is positive
        int evenCount = 0, oddCount = 0;

        while (num > 0) {
            int digit = num % 10;
            if (digit % 2 == 0) {
                evenCount++;
            } else {
                oddCount++;
            }
            num /= 10;
        }

        List<Integer> result = new ArrayList<>();
        result.add(evenCount);
        result.add(oddCount);
        return result;
    }
}

