class Solution {
    public int double_the_difference(List<Object> lst) {
        int sumOfSquares = 0;
        for (Object item : lst) {
            if (item instanceof Integer) {
                int num = (Integer) item;
                if (num > 0 && num % 2 != 0) {
                    sumOfSquares += num * num;
                }
            }
        }
        return sumOfSquares;
    }
}

