class Solution {
    public String find_max(List<String> words) {
        String maxWord = "";
        int maxUniqueChars = 0;

        for (String word : words) {
            Set<Character> uniqueChars = new HashSet<>();
            for (char c : word.toCharArray()) {
                uniqueChars.add(c);
            }

            int currentUniqueChars = uniqueChars.size();
            if (currentUniqueChars > maxUniqueChars || (currentUniqueChars == maxUniqueChars && word.compareTo(maxWord) < 0)) {
                maxWord = word;
                maxUniqueChars = currentUniqueChars;
            }
        }

        return maxWord;
    }
}

